#
# Structure for table "car"
#

DROP TABLE IF EXISTS `car`;
CREATE TABLE `car` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `bid` varchar(255) DEFAULT NULL COMMENT '品牌ID',
  `sid` int(11) DEFAULT NULL COMMENT '型号ID',
  `code` varchar(30) DEFAULT NULL COMMENT '车辆识别码',
  `color` varchar(10) DEFAULT NULL COMMENT '颜色',
  `pid` int(11) DEFAULT NULL COMMENT '车主ID',
  `status` int(11) DEFAULT '0' COMMENT '状态',
  `year` int(4) DEFAULT NULL COMMENT '年份',
  `km` float(10,2) DEFAULT NULL COMMENT '里程',
  `info` text COMMENT '备注',
  `hiredate` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '登记日期',
  `no` varchar(20) DEFAULT NULL COMMENT '车牌号',
  PRIMARY KEY (`id`),
  KEY `FK_SIZE` (`sid`),
  KEY `FK_CUSTOM` (`pid`),
  CONSTRAINT `FK_CUSTOM` FOREIGN KEY (`pid`) REFERENCES `custom` (`id`),
  CONSTRAINT `FK_SIZE` FOREIGN KEY (`sid`) REFERENCES `size` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8;

