DROP TABLE IF EXISTS `stock`;
CREATE TABLE `stock` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `cid` int(11) DEFAULT NULL COMMENT '配件ID',
  `quantity` float(7,2) DEFAULT NULL COMMENT '数量',
  `size` varchar(50) DEFAULT NULL COMMENT '型号',
  `price` float(7,2) DEFAULT NULL COMMENT '进价',
  `sale` float(7,2) DEFAULT NULL COMMENT '售价',
  `status` int(3) DEFAULT '0' COMMENT '状态',
  PRIMARY KEY (`id`),
  KEY `FK_COMPONENT_STOCK` (`cid`),
  CONSTRAINT `FK_COMPONENT_STOCK` FOREIGN KEY (`cid`) REFERENCES `component` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=113 DEFAULT CHARSET=utf8 COMMENT='配件库存';

